	# game_data array values:						
	# [0]: current level (level one = 0, level 2 = 1, level 3 = 2)		0
	# [1]: main menu select (0 = play, 1 = exit)				4
	# [2]: player location							8
	# [3]: x axis player movement (-1 = left, 0 = not moving, 1 = right)	12
	# [4]: jump (-1: falling, 0: grounded, 1-10: mid-jump)			16
	# [5]: health (0 = dead, 1, 2, 3)					20
	# [6]: coin 1 (0: not collected, 1: collected)				24
	# [7]: coin 2 (0: not collected, 1: collected)				28
	# [8]: coin 3 (0: not collected, 1: collected)				32
	
game_data: .word 0,0,0x10008000,0,0,3,0,0,0
	
.eqv    BASE_ADDRESS, 0x10008000
.eqv    MAX_ADDRESS, 0x10018000
.eqv	WHITE, 0xFFFFFF
.eqv	BLACK, 0x000000
.eqv    SPIKE, 0xFF0008		# Stationary obstacle that kills the player upon touching it
.eqv	SUN, 0xFAE500
.eqv    PLAYER, 0xFFFFB4
.eqv    PLATFORM2, 0xD99343	# Platform that player can't jump through
.eqv    SKY1, 0x66E6FF
.eqv    CLOUD1, 0x00B7EF
.text
main:           
    	li $s0, BASE_ADDRESS
   	li $s1, MAX_ADDRESS
   	j load_main_menu
   	
load_main_menu:
	la $t0, 0($s0)
    	la $t1, main_menu
	load_main_menu_enter_loop:
   	bge $t0, $s1, load_main_menu_exit_loop
    	lw $t2, 0($t1)
    	sw $t2, 0($t0)
    	addi $t0, $t0, 4
    	addi $t1, $t1, 4
	j load_main_menu_enter_loop
	load_main_menu_exit_loop:
	j set_start

main_menu_loop:
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	beq $t8, 1, main_menu_keypress
	j main_menu_loop

main_menu_keypress:
	lw $t2, 4($t9) 				# this assumes $t9 is set to 0xfff0000 from before
	beq $t2, 0x77, switch_menu_select	# ASCII code for 'w' is 0x77
	beq $t2, 0x73, switch_menu_select	# ASCII code for 's' is 0x73
	beq $t2, 0x20, menu_select 		# ASCII code of ' ' is 0x21
	j main_menu_loop

switch_menu_select:
	lw $t1, game_data+4
	beq $t1, 1, set_start			#If quit is set at game_data[1], load the game.
	j set_quit				#If play is set at game_data[1], quit the program.

set_quit:
	li $t1, WHITE		# Set 3 pixels beside 'play' to white
	sw $t1, 12348($s0)
	sw $t1, 12352($s0)
	sw $t1, 12356($s0)
	li $t1, BLACK		# Set 3 pixels beside 'quit' to black
	sw $t1, 13884($s0)
	sw $t1, 13888($s0)
	sw $t1, 13892($s0)
	li $t0, 1		# Set game_data[1] to 1 (represents quit)
	sw $t0, game_data + 4
	j main_menu_loop

set_start:
	li $t1, BLACK		# Set 3 pixels beside 'play' to black
	sw $t1, 12348($s0)
	sw $t1, 12352($s0)
	sw $t1, 12356($s0)
	li $t1, WHITE		# Set 3 pixels beside 'quit' to white
	sw $t1, 13884($s0)
	sw $t1, 13888($s0)
	sw $t1, 13892($s0)
	li $t0, 0		# Set game_data[1] to 0 (represents play)
	sw $t0, game_data + 4
	j main_menu_loop

menu_select:
	lw $t1, game_data+4	#Check game_data[1]'s value
	beq $t1, 0, game_setup	#If 0, start the game.
	j exit			#If 1, quit

game_setup:
   	sw $zero, game_data + 16
   	sw $zero, game_data + 20
	lw $t0, game_data
	beq, $t0, 0, setup_level_one
	setup_level_one:
	j load_level_one

load_level_one:
	la $t0, 0($s0)
    	la $t1, level_one
	load_level_one_enter_loop:
   	bge $t0, $s1, load_start_exit_loop
    	lw $t2, 0($t1)
    	sw $t2, 0($t0)
    	addi $t0, $t0, 4
    	addi $t1, $t1, 4
	j load_level_one_enter_loop
	load_start_exit_loop:
	la $t0, 15376($s0)		# Set player location in game_data\
	sw $t0, game_data + 8
   	j game

game:
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	beq $t8, 0, no_input
	jal keypress_happened

 	no_input:
 	lw $a0, game_data + 8
	jal replace_character
	
	j move_character
	
	after_physics:
	lw $a0, game_data + 8
	jal set_character
	sleep:
	li $v0, 32
	li $a0, 65
	syscall
	j game

move_character:
	lw $t0, game_data + 8		# Get player location
	lw $t1, game_data + 12		# Get player movement	
	beq $t1, 1, moving_right	# Check if player is moving right
	beqz $t1, after_physics		# Check if player is standing still
	li $t1, 256			# Player is moving left
	div $t0, $t1
	mfhi $t1			
	beq $t1, 0, after_physics	# If player at x = 0, don't move left
	
	addi $t0, $t0, -4
	sw $t0, game_data + 8
	j after_physics
	
	moving_right:
	li $t1, 256
	div $t0, $t1
	mfhi $t1			# Player is moving left
	beq $t1, 248, after_physics	# If player at x = , don't jump
	
	addi $t0, $t0, 4
	sw $t0, game_data + 8
	j after_physics

keypress_happened:
	lw $t0, 4($t9) 			# this assumes $t9 is set to 0xfff0000 from before
	beq $t0, 0x71, exit 		# reset game when 'q' is pressed (ASCII = 0x71)
	beq $t0, 0x72, reset 		# reset game when 'r' is pressed (ASCII = 0x72)
	beq $t0, 0x77, move_up 		# ASCII code of 'w' is 0x77
	beq $t0, 0x61, move_left 	# ASCII code of 'a' is 0x61
	beq $t0, 0x73, stop_x_movement 	# ASCII code of 's' is 0x73 or 115 in decimal
	beq $t0, 0x64, move_right 	# ASCII code of 'd' is 0x64
	j game

move_left:
	lw $t0, game_data + 12
	beq $t0, 1, stop_x_movement
	li $t1, -1
	sw $t1, game_data + 12
	jr $ra

move_right:
	lw $t0, game_data + 12
	beq $t0, -1, stop_x_movement
	li $t1, 1
	sw $t1, game_data + 12
	jr $ra

stop_x_movement:
	sw $zero, game_data + 12
	jr $ra

move_up:
	jr $ra

replace_character:
	lw $t1, game_data
	beq $t1, 0, level_one_sky
	level_one_sky:
	li $t0, SKY1
	j set_pixels
	
	set_pixels:
	sw $t0, 0($a0)		# Set head
	add $a0, $a0, 256
	
	sw $t0, 0($a0)		# Set body
	add $a0, $a0, 256
	
	sw $t0, 0($a0)		# Set legs
	add $a0, $a0, 256
	
	jr $ra

set_character:
	li $t0, PLAYER
	
	sw $t0, 0($a0)
	add $a0, $a0, 256
	
	sw $t0, 0($a0)
	add $a0, $a0, 256
	
	sw $t0, 0($a0)
	add $a0, $a0, 256
	
	jr $ra

reset:
	sw $zero, game_data
   	sw $zero, game_data + 0
   	sw $s0, game_data + 4
   	sw $zero, game_data + 8
   	sw $zero, game_data + 12
   	sw $zero, game_data + 16
   	li $t0, 3
   	sw $t0, game_data + 20
   	sw $t0, game_data + 24
   	sw $t0, game_data + 28
   	sw $t0, game_data + 32
   	j load_main_menu
exit:           
    li $v0, 10 # Gracefully exit
    syscall 


